        "alt": "Description"
    },
    {
        "img": rocket,
        "alt": "Description"
    },
    {
        "img": tiktok,
        "alt": "Description"
    },
    {
        "img": bars,
        "alt": "Description"
    },
    {
        "img": closed,
        "alt": "Description"
    }
];



export default img_ico;
